import './App.css';
import {BrowserRouter, Route, Switch} from "react-router-dom";
import Task from "./components/Task";

function App() {
    return (
        <div className="App">
            <BrowserRouter>
                <Switch>
                    <Route path="/">
                        <Task/>
                    </Route>
                    <Route path="/task">
                        <Task/>
                    </Route>
                    <Route path="/task">
                        <Task/>
                    </Route>
                </Switch>
            </BrowserRouter>

        </div>
    );
}

export default App;
